CREATE VIEW grouper_attr_assn_action_set_v AS
 SELECT ifhas.name AS if_has_attr_assn_action_name,
    thenhas.name AS then_has_attr_assn_action_name,
    gaaas.depth,
    gaaas.type,
    gaaaparentifhas.name AS parent_if_has_name,
    gaaaparentthenhas.name AS parent_then_has_name,
    gaaas.id,
    ifhas.id AS if_has_attr_assn_action_id,
    thenhas.id AS then_has_attr_assn_action_id,
    gaaas.parent_attr_assn_action_id
   FROM grouper_attr_assign_action_set gaaas,
    grouper_attr_assign_action_set gaaasparent,
    grouper_attr_assign_action gaaaparentifhas,
    grouper_attr_assign_action gaaaparentthenhas,
    grouper_attr_assign_action ifhas,
    grouper_attr_assign_action thenhas
  WHERE (((thenhas.id)::text = (gaaas.then_has_attr_assn_action_id)::text) AND ((ifhas.id)::text = (gaaas.if_has_attr_assn_action_id)::text) AND ((gaaas.parent_attr_assn_action_id)::text = (gaaasparent.id)::text) AND ((gaaaparentifhas.id)::text = (gaaasparent.if_has_attr_assn_action_id)::text) AND ((gaaaparentthenhas.id)::text = (gaaasparent.then_has_attr_assn_action_id)::text));


