    gadns.type,
    gadnparentifhas.name AS parent_if_has_name,
    gadnparentthenhas.name AS parent_then_has_name,
    gadns.id,
    ifhas.id AS if_has_attr_def_name_id,
    thenhas.id AS then_has_attr_def_name_id,
    gadns.parent_attr_def_name_set_id
   FROM grouper_attribute_def_name_set gadns,
    grouper_attribute_def_name_set gadnsparent,
    grouper_attribute_def_name gadnparentifhas,
    grouper_attribute_def_name gadnparentthenhas,
    grouper_attribute_def_name ifhas,
    grouper_attribute_def_name thenhas
  WHERE (((thenhas.id)::text = (gadns.then_has_attribute_def_name_id)::text) AND ((ifhas.id)::text = (gadns.if_has_attribute_def_name_id)::text) AND ((gadns.parent_attr_def_name_set_id)::text = (gadnsparent.id)::text) AND ((gadnparentifhas.id)::text = (gadnsparent.if_has_attribute_def_name_id)::text) AND ((gadnparentthenhas.id)::text = (gadnsparent.then_has_attribute_def_name_id)::text));


