--

CREATE VIEW grouper_audit_entry_v AS
 SELECT gae.created_on,
    gat.audit_category,
    gat.action_name,
    ( SELECT gm.subject_id
           FROM grouper_members gm
          WHERE ((gm.id)::text = (gae.logged_in_member_id)::text)) AS logged_in_subject_id,
    ( SELECT gm.subject_id
           FROM grouper_members gm
          WHERE ((gm.id)::text = (gae.act_as_member_id)::text)) AS act_as_subject_id,
    gat.label_string01,
    gae.string01,
    gat.label_string02,
    gae.string02,
    gat.label_string03,
    gae.string03,
    gat.label_string04,
    gae.string04,
    gat.label_string05,
    gae.string05,
    gat.label_string06,
    gae.string06,
    gat.label_string07,
    gae.string07,
    gat.label_string08,
    gae.string08,
    gat.label_int01,
    gae.int01,
    gat.label_int02,
    gae.int02,
    gat.label_int03,
    gae.int03,
    gat.label_int04,
    gae.int04,
    gat.label_int05,
    gae.int05,
    gae.context_id,
    gae.grouper_engine,
    gae.description,
    ( SELECT gm.subject_source
           FROM grouper_members gm
          WHERE ((gm.id)::text = (gae.logged_in_member_id)::text)) AS logged_in_source_id,
    ( SELECT gm.subject_source
           FROM grouper_members gm
          WHERE ((gm.id)::text = (gae.act_as_member_id)::text)) AS act_as_source_id,
    gae.logged_in_member_id,
    gae.act_as_member_id,
    gat.id AS audit_type_id,
    gae.user_ip_address,
    gae.server_host,
    gae.last_updated AS audit_entry_last_updated,
    gae.id AS audit_entry_id,
    gae.grouper_version,
    gae.env_name
   FROM grouper_audit_type gat,
    grouper_audit_entry gae
  WHERE ((gat.id)::text = (gae.audit_type_id)::text);


