CREATE VIEW grouper_aval_asn_attrdef_v AS
 SELECT gad_assigned_to.name AS name_of_attr_def_assigned_to,
    gaaa.name AS action,
    gadn.name AS attribute_def_name_name,
    gaav.value_string,
    gaav.value_integer,
    gaav.value_floating,
    gaav.value_member_id,
    gadn.display_name AS attribute_def_name_disp_name,
    gad.name AS name_of_attribute_def_assigned,
    gaa.notes AS attribute_assign_notes,
    gaa.enabled,
    gaa.enabled_time,
    gaa.disabled_time,
    gad_assigned_to.id AS id_of_attr_def_assigned_to,
    gaa.id AS attribute_assign_id,
    gadn.id AS attribute_def_name_id,
    gad.id AS attribute_def_id,
    gaaa.id AS action_id,
    gaav.id AS attribute_assign_value_id
   FROM grouper_attribute_assign gaa,
    grouper_attribute_def gad_assigned_to,
    grouper_attribute_def_name gadn,
    grouper_attribute_def gad,
    grouper_attr_assign_action gaaa,
    grouper_attribute_assign_value gaav
  WHERE (((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.owner_attribute_def_id)::text = (gad_assigned_to.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gadn.attribute_def_id)::text = (gad.id)::text) AND ((gaa.attribute_assign_action_id)::text = (gaaa.id)::text));


