--

CREATE VIEW grouper_aval_asn_mship_v AS
 SELECT gg.name AS group_name,
    gm.subject_source AS source_id,
    gm.subject_id,
    gaaa.name AS action,
    gadn.name AS attribute_def_name_name,
    gaav.value_string,
    gaav.value_integer,
    gaav.value_floating,
    gaav.value_member_id,
    gadn.display_name AS attribute_def_name_disp_name,
    gf.name AS list_name,
    gad.name AS name_of_attribute_def,
    gaa.notes AS attribute_assign_notes,
    gaa.attribute_assign_delegatable,
    gaa.enabled,
    gaa.enabled_time,
    gaa.disabled_time,
    gg.id AS group_id,
    gms.id AS membership_id,
    gm.id AS member_id,
    gaa.id AS attribute_assign_id,
    gadn.id AS attribute_def_name_id,
    gad.id AS attribute_def_id,
    gaaa.id AS action_id,
    gaav.id AS attribute_assign_value_id
   FROM grouper_attribute_assign gaa,
    grouper_groups gg,
    grouper_memberships gms,
    grouper_attribute_def_name gadn,
    grouper_attribute_def gad,
    grouper_members gm,
    grouper_fields gf,
    grouper_attr_assign_action gaaa,
    grouper_attribute_assign_value gaav
  WHERE (((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.owner_membership_id)::text = (gms.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gadn.attribute_def_id)::text = (gad.id)::text) AND ((gms.field_id)::text = (gf.id)::text) AND ((gms.member_id)::text = (gm.id)::text) AND ((gms.owner_group_id)::text = (gg.id)::text) AND ((gf.type)::text = 'list'::text) AND ((gaa.attribute_assign_action_id)::text = (gaaa.id)::text));


