--
-- Name: grouper_composites_v; Type: VIEW; Schema: public; Owner: grouper
--

CREATE VIEW grouper_composites_v AS
 SELECT ( SELECT gg.name
           FROM grouper_groups gg
          WHERE ((gg.id)::text = (gc.owner)::text)) AS owner_group_name,
    gc.type AS composite_type,
    ( SELECT gg.name
           FROM grouper_groups gg
          WHERE ((gg.id)::text = (gc.left_factor)::text)) AS left_factor_group_name,
    ( SELECT gg.name
           FROM grouper_groups gg
          WHERE ((gg.id)::text = (gc.right_factor)::text)) AS right_factor_group_name,
    ( SELECT gg.display_name
           FROM grouper_groups gg
          WHERE ((gg.id)::text = (gc.owner)::text)) AS owner_group_displayname,
    ( SELECT gg.display_name
           FROM grouper_groups gg
          WHERE ((gg.id)::text = (gc.left_factor)::text)) AS left_factor_group_displayname,
    ( SELECT gg.display_name
           FROM grouper_groups gg
          WHERE ((gg.id)::text = (gc.right_factor)::text)) AS right_factor_group_displayname,
    gc.owner AS owner_group_id,
    gc.left_factor AS left_factor_group_id,
    gc.right_factor AS right_factor_group_id,
    gc.id AS composite_id,
    gc.create_time,
    gc.creator_id,
    gc.hibernate_version_number,
    gc.context_id
   FROM grouper_composites gc;


