-- Name: grouper_memberships_lw_v; Type: VIEW; Schema: public; Owner: grouper
--

CREATE VIEW grouper_memberships_lw_v AS
 SELECT DISTINCT gm.subject_id,
    gm.subject_source,
    gg.name AS group_name,
    gfl.name AS list_name,
    gfl.type AS list_type,
    gg.id AS group_id,
    gm.id AS member_id
   FROM grouper_memberships_all_v gms,
    grouper_members gm,
    grouper_groups gg,
    grouper_fields gfl
  WHERE (((gms.owner_group_id)::text = (gg.id)::text) AND ((gms.field_id)::text = (gfl.id)::text) AND ((gms.member_id)::text = (gm.id)::text) AND ((gms.immediate_mship_enabled)::text = 'T'::text));


