--
-- Name: VIEW grouper_memberships_v; Type: COMMENT; Schema: public; Owner: grouper
--

COMMENT ON VIEW grouper_memberships_v IS 'Grouper_memberships_v holds one record for each membership or privilege in the system for members to groups or stems (for privileges).  This is denormalized so there are records for the actual immediate relationships, and the cascaded effective relationships.  This has friendly names.';


--
