--
-- Name: grouper_perms_role_subject_v; Type: VIEW; Schema: public; Owner: grouper
--

CREATE VIEW grouper_perms_role_subject_v AS
 SELECT DISTINCT gr.name AS role_name,
    gm.subject_source AS subject_source_id,
    gm.subject_id,
    gaaa.name AS action,
    gadn.name AS attribute_def_name_name,
    gadn.display_name AS attribute_def_name_disp_name,
    gr.display_name AS role_display_name,
    gaa.attribute_assign_delegatable,
    gaa.enabled,
    gaa.enabled_time,
    gaa.disabled_time,
    gr.id AS role_id,
    gadn.attribute_def_id,
    gm.id AS member_id,
    gadn.id AS attribute_def_name_id,
    gaaa.id AS action_id,
    gmav.depth AS membership_depth,
    '-1'::integer AS role_set_depth,
    gadns.depth AS attr_def_name_set_depth,
    gaaas.depth AS attr_assign_action_set_depth,
    gmav.membership_id,
    gaa.id AS attribute_assign_id,
    'role_subject'::text AS permission_type,
    gaa.notes AS assignment_notes,
    gmav.immediate_mship_enabled_time,
    gmav.immediate_mship_disabled_time,
    gaa.disallowed
   FROM grouper_groups gr,
    grouper_memberships_all_v gmav,
    grouper_members gm,
    grouper_fields gf,
    grouper_attribute_def gad,
    grouper_attribute_assign gaa,
    grouper_attribute_def_name gadn,
    grouper_attribute_def_name_set gadns,
    grouper_attr_assign_action gaaa,
    grouper_attr_assign_action_set gaaas
  WHERE (((gmav.owner_group_id)::text = (gr.id)::text) AND ((gr.type_of_group)::text = 'role'::text) AND ((gmav.field_id)::text = (gf.id)::text) AND ((gmav.owner_group_id)::text = (gaa.owner_group_id)::text) AND ((gmav.member_id)::text = (gaa.owner_member_id)::text) AND ((gf.type)::text = 'list'::text) AND ((gf.name)::text = 'members'::text) AND ((gmav.immediate_mship_enabled)::text = 'T'::text) AND ((gmav.member_id)::text = (gm.id)::text) AND ((gadn.attribute_def_id)::text = (gad.id)::text) AND ((gad.attribute_def_type)::text = 'perm'::text) AND ((gaa.attribute_assign_type)::text = 'any_mem'::text) AND ((gaa.attribute_def_name_id)::text = (gadns.if_has_attribute_def_name_id)::text) AND ((gadn.id)::text = (gadns.then_has_attribute_def_name_id)::text) AND ((gaa.attribute_assign_action_id)::text = (gaaas.if_has_attr_assn_action_id)::text) AND ((gaaa.id)::text = (gaaas.then_has_attr_assn_action_id)::text));


