-- Name: grouper_role_set_v; Type: VIEW; Schema: public; Owner: grouper
--

CREATE VIEW grouper_role_set_v AS
 SELECT ifhas.name AS if_has_role_name,
    thenhas.name AS then_has_role_name,
    grs.depth,
    grs.type,
    grparentifhas.name AS parent_if_has_name,
    grparentthenhas.name AS parent_then_has_name,
    grs.id,
    ifhas.id AS if_has_role_id,
    thenhas.id AS then_has_role_id,
    grs.parent_role_set_id
   FROM grouper_role_set grs,
    grouper_role_set grsparent,
    grouper_groups grparentifhas,
    grouper_groups grparentthenhas,
    grouper_groups ifhas,
    grouper_groups thenhas
  WHERE (((thenhas.id)::text = (grs.then_has_role_id)::text) AND ((ifhas.id)::text = (grs.if_has_role_id)::text) AND ((grs.parent_role_set_id)::text = (grsparent.id)::text) AND ((grparentifhas.id)::text = (grsparent.if_has_role_id)::text) AND ((grparentthenhas.id)::text = (grsparent.then_has_role_id)::text));


