--
-- Name: grouper_roles_v; Type: VIEW; Schema: public; Owner: grouper
--

CREATE VIEW grouper_roles_v AS
 SELECT gg.extension,
    gg.name,
    gg.display_extension,
    gg.display_name,
    gg.description,
    gs.name AS parent_stem_name,
    gg.id AS role_id,
    gs.id AS parent_stem_id,
    ( SELECT gm.subject_source
           FROM grouper_members gm
          WHERE ((gm.id)::text = (gg.modifier_id)::text)) AS modifier_source,
    ( SELECT gm.subject_id
           FROM grouper_members gm
          WHERE ((gm.id)::text = (gg.modifier_id)::text)) AS modifier_subject_id,
    ( SELECT gm.subject_source
           FROM grouper_members gm
          WHERE ((gm.id)::text = (gg.creator_id)::text)) AS creator_source,
    ( SELECT gm.subject_id
           FROM grouper_members gm
          WHERE ((gm.id)::text = (gg.creator_id)::text)) AS creator_subject_id,
    ( SELECT DISTINCT 'T'::text
           FROM grouper_composites gc
          WHERE ((gc.owner)::text = (gg.id)::text)) AS is_composite_owner,
    ( SELECT DISTINCT 'T'::text
           FROM grouper_composites gc
          WHERE (((gc.left_factor)::text = (gg.id)::text) OR ((gc.right_factor)::text = (gg.id)::text))) AS is_composite_factor,
    gg.creator_id,
    gg.create_time,
    gg.modifier_id,
    gg.modify_time,
    gg.hibernate_version_number,
    gg.context_id
   FROM grouper_groups gg,
    grouper_stems gs
  WHERE (((gg.parent_stem)::text = (gs.id)::text) AND ((gg.type_of_group)::text = 'role'::text));


