CREATE VIEW grouper_rpt_group_field_v AS
 SELECT gg.name AS group_name,
    gg.display_name AS group_displayname,
    gf.type AS field_type,
    gf.name AS field_name,
    count(DISTINCT gms.member_id) AS member_count
   FROM grouper_memberships_all_v gms,
    grouper_groups gg,
    grouper_fields gf
  WHERE (((gms.field_id)::text = (gf.id)::text) AND ((gg.id)::text = (gms.owner_group_id)::text))
  GROUP BY gg.name, gg.display_name, gf.type, gf.name;


