-- Name: grouper_rpt_groups_v; Type: VIEW; Schema: public; Owner: grouper
--

CREATE VIEW grouper_rpt_groups_v AS
 SELECT gg.name AS group_name,
    gg.display_name AS group_displayname,
    gg.type_of_group,
    ( SELECT count(DISTINCT gms.member_id) AS count
           FROM grouper_memberships_all_v gms
          WHERE (((gms.owner_group_id)::text = (gg.id)::text) AND ((gms.mship_type)::text = 'immediate'::text))) AS immediate_membership_count,
    ( SELECT count(DISTINCT gms.member_id) AS count
           FROM grouper_memberships_all_v gms
          WHERE ((gms.owner_group_id)::text = (gg.id)::text)) AS membership_count,
    ( SELECT count(*) AS count
           FROM grouper_composites gc
          WHERE (((gc.left_factor)::text = (gg.id)::text) OR ((gc.right_factor)::text = (gg.id)::text))) AS isa_composite_factor_count,
    ( SELECT count(DISTINCT gms.owner_group_id) AS count
           FROM grouper_memberships_all_v gms,
            grouper_members gm
          WHERE (((gm.subject_id)::text = (gg.id)::text) AND ((gms.member_id)::text = (gm.id)::text))) AS isa_member_count,
    gg.id AS group_id
   FROM grouper_groups gg;


