CREATE VIEW grouper_rules_v AS
 SELECT main_gaa.attribute_assign_type AS assigned_to_type,
    ( SELECT gg.name
           FROM grouper_groups gg
          WHERE ((gg.id)::text = (main_gaa.owner_group_id)::text)) AS assigned_to_group_name,
    ( SELECT gs.name
           FROM grouper_stems gs
          WHERE ((gs.id)::text = (main_gaa.owner_stem_id)::text)) AS assigned_to_stem_name,
    ( SELECT gm.subject_id
           FROM grouper_members gm
          WHERE ((gm.id)::text = (main_gaa.owner_member_id)::text)) AS assigned_to_member_subject_id,
    ( SELECT gad.name
           FROM grouper_attribute_def gad
          WHERE ((gad.id)::text = (main_gaa.owner_attribute_def_id)::text)) AS assigned_to_attribute_def_name,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleCheckType'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_check_type,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleCheckOwnerId'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_check_owner_id,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleCheckOwnerName'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_check_owner_name,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleCheckStemScope'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_check_stem_scope,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleCheckArg0'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_check_arg0,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleCheckArg1'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_check_arg1,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleIfConditionEl'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_if_condition_el,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleIfConditionEnum'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_if_condition_enum,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleIfConditionEnumArg0'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_if_condition_enum_arg0,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleIfConditionEnumArg1'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_if_condition_enum_arg1,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleIfOwnerId'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_if_owner_id,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleIfOwnerName'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_if_owner_name,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleIfStemScope'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_if_stem_scope,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleThenEl'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_then_el,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleThenEnum'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_then_enum,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleThenEnumArg0'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_then_enum_arg0,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleThenEnumArg1'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_then_enum_arg1,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleThenEnumArg2'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_then_enum_arg2,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleValid'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_valid,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleRunDaemon'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_run_daemon,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleActAsSubjectId'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_act_as_subject_id,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleActAsSubjectIdentifier'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_act_as_subject_identifier,
    ( SELECT gaav.value_string
           FROM grouper_attribute_assign gaa,
            grouper_attribute_assign_value gaav,
            grouper_attribute_def_name gadn
          WHERE (((gadn.name)::text = 'etc:attribute:rules:ruleActAsSubjectSourceId'::text) AND ((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gaa.owner_attribute_assign_id)::text = (main_gaa.id)::text) AND ((gaa.enabled)::text = 'T'::text))) AS rule_act_as_subject_source_id,
    main_gaa.enabled AS assignment_enabled,
    main_gaa.id AS attribute_assign_id
   FROM grouper_attribute_assign main_gaa,
    grouper_attribute_def_name main_gadn
  WHERE (((main_gadn.name)::text = 'etc:attribute:rules:rule'::text) AND ((main_gaa.attribute_def_name_id)::text = (main_gadn.id)::text));


