-- Name: grouper_stem_set_v; Type: VIEW; Schema: public; Owner: grouper
--

CREATE VIEW grouper_stem_set_v AS
 SELECT ifhas.name AS if_has_stem_name,
    thenhas.name AS then_has_stem_name,
    gss.depth,
    gss.type,
    gsparentifhas.name AS parent_if_has_name,
    gsparentthenhas.name AS parent_then_has_name,
    gss.id,
    ifhas.id AS if_has_stem_id,
    thenhas.id AS then_has_stem_id,
    gss.parent_stem_set_id
   FROM grouper_stem_set gss,
    grouper_stem_set gssparent,
    grouper_stems gsparentifhas,
    grouper_stems gsparentthenhas,
    grouper_stems ifhas,
    grouper_stems thenhas
  WHERE (((thenhas.id)::text = (gss.then_has_stem_id)::text) AND ((ifhas.id)::text = (gss.if_has_stem_id)::text) AND ((gss.parent_stem_set_id)::text = (gssparent.id)::text) AND ((gsparentifhas.id)::text = (gssparent.if_has_stem_id)::text) AND ((gsparentthenhas.id)::text = (gssparent.then_has_stem_id)::text));


